import React from "react";

const Main = () => {
    return (
        <div>
            <h1>Strona z pozytywnymi memami</h1>
            <p>Witamy na stronie ze śmiesznymi obrazkami, które spróbują nastawić Cię pozytywnie do życia.</p>
            <p>Zapraszam do zapoznania się z plikiem README.md
            <details>
<summary>README</summary>
<p>
Tutaj umieszczamy szczegółowy opis grafiki.
</p>
</details>
            </p>
        </div>
    );
};

export default Main;
